// Inisialisasi peta Leaflet
function initMap() {
    // Tampilkan loading overlay
    document.getElementById('loadingOverlay').style.display = 'flex';
    
    // Inisialisasi peta dengan view ke Indonesia
    map = L.map('indonesiaMap').setView([-2.5489, 118.0149], 5);
    
    // Tambahkan tile layer dari OpenStreetMap
    L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png', {
        attribution: 'Â© OpenStreetMap contributors',
        maxZoom: 12,
        minZoom: 4
    }).addTo(map);
    
    // Tambahkan marker untuk setiap data
    addMarkersToMap();
    
    // Update statistik
    updateMapStats();
    
    // Load daftar provinsi
    loadProvinceList();
    
    // Sembunyikan loading setelah 1 detik (simulasi loading data)
    setTimeout(() => {
        document.getElementById('loadingOverlay').style.display = 'none';
    }, 1000);
}

// Tambahkan marker ke peta
function addMarkersToMap() {
    // Hapus marker lama
    markers.forEach(marker => map.removeLayer(marker));
    markers = [];
    
    // Filter data berdasarkan filter aktif
    const filteredData = petaData.filter(item => {
        if (currentFilter === 'all') return true;
        if (currentFilter === 'energi') return item.type === 'energi';
        if (currentFilter === 'kearifan') return item.type === 'kearifan';
        if (currentFilter === 'aktif') return item.status === 'aktif';
        if (currentFilter === 'rencana') return item.status === 'rencana' || item.status === 'uji-coba';
        return true;
    });
    
    // Tambahkan marker baru
    filteredData.forEach(item => {
        if (!item.koordinat || item.koordinat.length !== 2) return;
        
        // Tentukan warna marker berdasarkan jenis
        let markerColor = 'blue';
        let markerIcon = 'circle';
        
        if (item.type === 'energi') {
            markerColor = item.status === 'aktif' ? 'green' : 
                         item.status === 'rencana' ? 'orange' : 'gray';
            markerIcon = 'bolt';
        } else if (item.type === 'kearifan') {
            markerColor = 'orange';
            markerIcon = 'seedling';
        }
        
        // Buat custom icon
        const icon = L.divIcon({
            className: 'custom-marker',
            html: `<div class="marker-icon marker-${markerColor}">
                     <i class="fas fa-${markerIcon}"></i>
                   </div>`,
            iconSize: [40, 40],
            iconAnchor: [20, 40],
            popupAnchor: [0, -40]
        });
        
        // Tambahkan marker ke peta
        const marker = L.marker(item.koordinat, { icon: icon })
            .addTo(map)
            .bindPopup(`
                <div class="map-popup">
                    <h3>${item.judul}</h3>
                    <p><strong>Lokasi:</strong> ${item.lokasi}, ${item.provinsi}</p>
                    <p><strong>Jenis:</strong> ${item.type === 'energi' ? 'Energi Terbarukan' : 'Kearifan Lokal'}</p>
                    <p><strong>Status:</strong> ${item.status || 'Aktif'}</p>
                    <p><strong>Kategori:</strong> ${item.kategori}</p>
                    ${item.kapasitas ? `<p><strong>Kapasitas:</strong> ${item.kapasitas}</p>` : ''}
                    ${item.usia ? `<p><strong>Usia:</strong> ${item.usia}</p>` : ''}
                    <button onclick="showDetail('${item.id}')" class="popup-btn">Lihat Detail</button>
                </div>
            `);
        
        // Event listener untuk klik marker
        marker.on('click', () => {
            showLocationInfo(item);
        });
        
        markers.push(marker);
    });
}

