// Load cards dengan pagination
function loadCards(id, data, page = 1) {
    const container = document.getElementById(id);
    const startIndex = (page - 1) * itemsPerPage;
    const endIndex = startIndex + itemsPerPage;
    const pageData = data.slice(0, endIndex);

    container.innerHTML = '';

    pageData.forEach(item => {
        const card = document.createElement('div');
        card.className = 'card';
        card.innerHTML = `
            <img src="${item.img}" alt="${item.judul}" loading="lazy">
            <div class="card-content">
                <h3>${item.judul}</h3>
                <p>${item.deskripsi}</p>
                <div class="card-tags">
                    <span class="card-tag">${item.kategori}</span>
                    <span class="card-tag">${item.lokasi}</span>
                    <span class="card-tag ${item.status || 'aktif'}">${item.status || 'Aktif'}</span>
                </div>
                <p class="card-detail">${item.detail}</p>
                <div class="card-footer">
                    <span><i class="fas fa-users"></i> ${item.masyarakat || '0'} orang</span>
                    <span><i class="fas fa-calendar-alt"></i> ${item.tahun || 'Tradisional'}</span>
                </div>
            </div>
        `;
        
        card.addEventListener('click', () => {
            showDetail(item.id);
        });
        
        container.appendChild(card);
    });

    // Animasi masuk
    const cards = container.querySelectorAll('.card');
    cards.forEach((card, index) => {
        card.style.animationDelay = `${index * 0.1}s`;
        card.classList.add('animate-fade-in');
    });
}

// Filter cards
function filterByCategory(category, type) {
    const buttons = document.querySelectorAll(`#${type} .filter-btn`);
    buttons.forEach(btn => btn.classList.remove('active'));
    event.target.classList.add('active');

    if (type === 'energi') {
        filteredEnergiData = category === 'all' 
            ? [...energiData] 
            : energiData.filter(item => item.kategori === category);
        currentEnergiPage = 1;
        loadCards('energiList', filteredEnergiData, currentEnergiPage);
    } else {
        filteredKearifanData = category === 'all'
            ? [...kearifanData]
            : kearifanData.filter(item => item.kategori === category);
        currentKearifanPage = 1;
        loadCards('kearifanList', filteredKearifanData, currentKearifanPage);
    }
}

// Search cards
function filterCards(type) {
    const searchId = type === 'energi' ? 'searchEnergi' : 'searchKearifan';
    const searchTerm = document.getElementById(searchId).value.toLowerCase();
    
    if (type === 'energi') {
        filteredEnergiData = energiData.filter(item => 
            item.judul.toLowerCase().includes(searchTerm) ||
            item.deskripsi.toLowerCase().includes(searchTerm) ||
            item.kategori.toLowerCase().includes(searchTerm) ||
            item.lokasi.toLowerCase().includes(searchTerm)
        );
        currentEnergiPage = 1;
        loadCards('energiList', filteredEnergiData, currentEnergiPage);
    } else {
        filteredKearifanData = kearifanData.filter(item => 
            item.judul.toLowerCase().includes(searchTerm) ||
            item.deskripsi.toLowerCase().includes(searchTerm) ||
            item.kategori.toLowerCase().includes(searchTerm) ||
            item.lokasi.toLowerCase().includes(searchTerm)
        );
        currentKearifanPage = 1;
        loadCards('kearifanList', filteredKearifanData, currentKearifanPage);
    }
}

// Load more items
function loadMore(type) {
    if (type === 'energi') {
        currentEnergiPage++;
        loadCards('energiList', filteredEnergiData, currentEnergiPage);
        
        if (currentEnergiPage * itemsPerPage >= filteredEnergiData.length) {
            document.querySelector('#energi .load-more').style.display = 'none';
        }
    } else {
        currentKearifanPage++;
        loadCards('kearifanList', filteredKearifanData, currentKearifanPage);
        
        if (currentKearifanPage * itemsPerPage >= filteredKearifanData.length) {
            document.querySelector('#kearifan .load-more').style.display = 'none';
        }
    }
}

