// Download data
function downloadData(type) {
    let data, filename, content;
    
    switch(type) {
        case 'energi':
            data = energiData;
            filename = 'data-energi-terbarukan.csv';
            content = convertToCSV(data);
            break;
        case 'kearifan':
            data = kearifanData;
            filename = 'data-kearifan-lokal.csv';
            content = convertToCSV(data);
            break;
        case 'peta':
            data = petaData;
            filename = 'data-peta-nusantara.xlsx';
            // Simulasi download (dalam implementasi nyata akan menggunakan library)
            alert(`Data ${filename} akan diunduh.`);
            return;
        default:
            return;
    }
    
    const blob = new Blob([content], { type: 'text/csv;charset=utf-8;' });
    const link = document.createElement('a');
    link.href = URL.createObjectURL(blob);
    link.download = filename;
    link.click();
}

// Convert to CSV
function convertToCSV(data) {
    const headers = Object.keys(data[0]);
    const rows = data.map(row => 
        headers.map(header => 
            JSON.stringify(row[header] || '')
        ).join(',')
    );
    return [headers.join(','), ...rows].join('\n');
}

