// ===========================================
// EVENT LISTENERS & INITIALIZATION
// ===========================================

document.addEventListener("DOMContentLoaded", () => {
    // Initialize components
    initMap();
    initCharts();
    initGallery();
    
    // Load initial data
    loadCards("energiList", energiData, currentEnergiPage);
    loadCards("kearifanList", kearifanData, currentKearifanPage);
    
    // Setup event listeners
    document.getElementById('themeToggle').addEventListener('click', toggleTheme);
    document.getElementById('mapSearchBtn').addEventListener('click', searchMap);
    document.getElementById('mapSearch').addEventListener('keypress', (e) => {
        if (e.key === 'Enter') searchMap();
    });
    
    // Map filter buttons
    document.querySelectorAll('.map-filter-btn').forEach(btn => {
        btn.addEventListener('click', () => filterMap(btn.dataset.filter));
    });
    
    // Gallery filter buttons
    document.querySelectorAll('.gallery-filter').forEach(btn => {
        btn.addEventListener('click', () => filterGallery(btn.dataset.filter));
    });
    
    // Lightbox events
    document.querySelector('.close-lightbox').addEventListener('click', closeLightbox);
    document.querySelector('.lightbox-nav.prev').addEventListener('click', () => navigateLightbox(-1));
    document.querySelector('.lightbox-nav.next').addEventListener('click', () => navigateLightbox(1));
    
    // Modal events
    document.querySelector('.close-modal').addEventListener('click', closeModal);
    document.getElementById('contributeModal').addEventListener('click', (e) => {
        if (e.target === document.getElementById('contributeModal')) {
            closeModal();
        }
    });
    
    // Setup lainnya
    setupBackToTop();
    setupProgressBar();
    setupHamburgerMenu();
    setupNavbarScroll();
    
    // Load saved theme
    const savedTheme = localStorage.getItem('theme') || 'light';
    if (savedTheme === 'dark') {
        document.body.classList.add('dark-mode');
        document.querySelector('#themeToggle i').className = 'fas fa-sun';
    }
    
    // Initialize active menu
    updateActiveMenu();
    
    // Keyboard navigation for lightbox
    document.addEventListener('keydown', (e) => {
        const lightbox = document.getElementById('lightbox');
        if (lightbox.classList.contains('active')) {
            if (e.key === 'Escape') closeLightbox();
            if (e.key === 'ArrowLeft') navigateLightbox(-1);
            if (e.key === 'ArrowRight') navigateLightbox(1);
        }
    });
});

